INSERT INTO `ps_product_lang` VALUES
('1','1','1','<p>The main fabric of this product contains 100% Land to Market verified wool which means the material has been sourced from land showing positive environmental outcomes, measured using the Ecological Outcome Verification protocol. Regenerative farmers manage their land and livestock in a way that mimics wild herds of animals. This restored relationship between the grazing sheep and the grassland leads to a thriving ecosystem, promoting soil health, biodiversity, carbon sequestration, and water cycle restoration. The origin of the wool is fully traceable. Our approach: We are committed to the sustainable and ethical management of our operations. The goal of reducing our environmental impact influences our decisions. At all levels and in all localeswhether at offices and stores or along the supply chainwe respect high standards for social and ecological responsibility. Balenciaga is also fur- and exotic leather-free. Read more ... Carbon footprint: we work to continually reduce the environmental footprint of our products. The remaining carbon emissions associated with all activities in this products life cycle are carefully calculated, and we commit to invest funds into carbon removal projects that protect and restore natural ecosystems to tackle climate change.</p><p></p>','<p>Deconstructed Jacket in black dry wool twill is from several looks of the Balenciaga\'s Winter 23 Collection.</p><p></p>','deconstructed-jacket-in-black',NULL,NULL,NULL,'Deconstructed Jacket in Black','W magazynie',NULL,NULL,NULL),
