('1265','1','1','<p>Details: In this line, 100% of the leather is tanned using metal-free methods. A metal-free tanning method is more respectful of the environment as it results in less water, air, and soil pollutants. Our target is that 100% of the leather used at Balenciaga will be metal-free in 2025. Our approach: We are committed to the sustainable and ethical management of our operations. The goal of reducing our environmental impact influences our decisions. At all levels and in all localeswhether at offices and stores or along the supply chainwe respect high standards for social and ecological responsibility. Balenciaga is also fur- and exotic leather-free. Read more ... Carbon footprint: we work to continually reduce the environmental footprint of our products. The remaining carbon emissions associated with all activities in this products life cycle are carefully calculated, and we commit to invest funds into carbon removal projects that protect and restore natural ecosystems to tackle climate change.</p><p></p>','<p>Le Cagole Men Toiletry Pouch in black Arena lambskin</p><p></p>','men-s-le-cagole-men-toiletry-pouch-in-black',NULL,NULL,NULL,'Men\'s Le Cagole Men Toiletry Pouch in Black','W magazynie',NULL,NULL,NULL);
